import numpy as np
import pandas as pd

from matplotlib import pyplot as plt
from scipy.signal import savgol_filter


def min_max_scaler(data,max_value,min_value):
    return [(x - min_value) / (max_value - min_value) for x in data]



def moving_average(data, window_size):
    """
    计算数据的移动平均值
    :param data: 原始数据数组
    :param window_size: 平均窗口大小
    :return: 平滑后的数据
    """
    return np.convolve(data, np.ones(window_size) / window_size, mode='valid')

def getL(l,max_value,min_value):
    l = min_max_scaler(l, max_value, min_value)
    # smoothed_data = pd.Series(l).rolling(window=window_size, center=True).mean()
    smoothed_data = savgol_filter(l, window_length=97, polyorder=3)
    # smoothed_data = moving_average(l, 100)
    return smoothed_data
def getL2(l,max_value,min_value):
    l = min_max_scaler(l, max_value, min_value)
    window_size = 6
    smoothed_data = pd.Series(l).rolling(window=window_size, center=True).mean()
    return smoothed_data

def smooth(data, weight=0.97):
    last = data[0]
    smoothed = []
    for point in data:
        smoothed_val = last * weight + (1 - weight) * point
        smoothed.append(smoothed_val)
        last = smoothed_val
    return smoothed

